// frontend/src/components/Quiz/Student/QuizResultStudent.js
import React, { useState, useEffect, useCallback } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import { getStudentAttemptDetails } from '../../../services/api';
import Modal from '../../common/Modal'; // Assuming Modal.js is in src/components/common/
import {
    FaSpinner, FaCheckCircle, FaTimesCircle, FaLightbulb, FaArrowLeft,
    FaPercentage, FaQuestionCircle, FaCommentDots, FaExclamationCircle
} from 'react-icons/fa';
import '../../../styles/QuizComponents.css'; // For specific quiz result styles
import '../../../styles/StudentDashboard.css'; // For general layout if not full page modal

function QuizResultStudent() {
    const { attemptId } = useParams();
    const navigate = useNavigate();
    const [attemptDetails, setAttemptDetails] = useState(null);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState('');

    const showError = useCallback((msg) => setError(msg), []);

    useEffect(() => {
        if (!attemptId) {
            showError("Attempt ID is missing.");
            setIsLoading(false);
            return;
        }
        console.log(`QuizResultStudent: Fetching attempt details for ID: ${attemptId}`);
        setIsLoading(true);
        setError('');
        getStudentAttemptDetails(attemptId)
            .then(response => {
                console.log("QuizResultStudent: Fetched attempt data:", response.data);
                setAttemptDetails(response.data);
            })
            .catch(err => {
                console.error("Error fetching attempt details:", err);
                showError(err.response?.data?.error || "Could not load your quiz results.");
                setAttemptDetails(null);
            })
            .finally(() => setIsLoading(false));
    }, [attemptId, showError]);

    const handleCloseModalAndNavigate = () => {
        // Navigate back to the student's quiz list or main student dashboard
        navigate('/student/dashboard'); // Or specific quiz list path if preferred
    };

    if (isLoading) {
        return (
            <Modal title="Loading Results..." onClose={handleCloseModalAndNavigate} width="700px">
                <div className="loading-items" style={{minHeight: '200px'}}>
                    <FaSpinner className="spin" /> Loading your results...
                </div>
            </Modal>
        );
    }

    if (error || !attemptDetails) {
        return (
            <Modal title="Error" onClose={handleCloseModalAndNavigate} width="500px">
                <div className="message error-message global-message" style={{ margin: 0 }}>
                    <FaExclamationCircle size={24} style={{ marginRight: '10px' }} />
                    {error || "Could not load quiz results."}
                </div>
            </Modal>
        );
    }

    const { score, total_questions, correct_answers, answers = [], quiz_title } = attemptDetails;

    return (
        <Modal title={`Results: ${quiz_title || 'Quiz'}`} onClose={handleCloseModalAndNavigate} width="800px">
            <div className="quiz-result-container">
                <div className="result-summary">
                    <h3>Your Score: <span className={`score ${score >= 70 ? 'good' : score >= 40 ? 'average' : 'poor'}`}>{score !== null ? score.toFixed(0) : 'N/A'}%</span></h3>
                    <p><FaCheckCircle className="icon-correct"/> Correct: {correct_answers || 0} / {total_questions || 0}</p>
                </div>

                <div className="result-questions-list">
                    {answers.map((answer, index) => (
                        <div key={answer.id || index} className={`result-question-item ${answer.is_correct === true ? 'correct' : answer.is_correct === false ? 'incorrect' : 'ungraded'}`}>
                            <div className="question-header">
                                <h4><FaQuestionCircle/> Question {index + 1}</h4>
                                {answer.is_correct === true && <FaCheckCircle className="status-icon correct" title="Correct"/>}
                                {answer.is_correct === false && <FaTimesCircle className="status-icon incorrect" title="Incorrect"/>}
                            </div>
                            <p className="question-text-result">{answer.question_text || "Question text not available."}</p>
                            <p className="student-answer-result"><strong>Your Answer:</strong> {answer.answer_text || "Not answered"}</p>
                            {answer.is_correct === false && (
                                <>
                                    {/* The backend's `get_correct_answer_value` in Question model is needed here */}
                                    {/* For now, we assume this might come with the attempt details if modified */}
                                    {/* <p className="correct-answer-reveal"><strong>Correct Answer:</strong> {answer.correct_answer_text || "N/A"}</p> */}
                                    {answer.ai_feedback && (
                                        <div className="ai-feedback-result">
                                            <p><strong><FaLightbulb /> AI Feedback:</strong> {answer.ai_feedback}</p>
                                        </div>
                                    )}
                                </>
                            )}
                        </div>
                    ))}
                </div>
            </div>
        </Modal>
    );
}

export default QuizResultStudent;
